ibrary(tidyverse) \n","\n"]},{"cell_type":"markdown","id":"0b1db232","metadata":{"_cell_guid":"b94c7eee-d943-46c0-838a-f01be843d17e","_uuid":"d3ee4d29-4800-4d8e-882c-79f804325189","papermill":{"duration":0.011311,"end_time":"2022-10-21T19:32:32.302804","exception":false,"start_time":"2022-10-21T19:32:32.291493","status":"completed"},"tags":[]},"source":["# Introduction\n","Bellabeat is a high-tech manufacturer of women's health products. As a junior data analyst at Bellabeat, a high-tech manufacturer of health-focused goods for women, I work with the marketing analyst team. Bellabeat is a successful little business with the potential to grow into a major player in the global smart device industry. Urška Sršen, cofounder and Chief Creative Officer of Bellabeat, believes that examining smart device fitness data could help the company discover new development prospects. I was requested to concentrate on one of Bellabeat's products and analyse smart device data to acquire insight into how users use their smart devices. Urka Sren is sure that an examination of non-Bellebeat customer data (for example, FitBit fitness tracker usage data) would discover other growth potential. The data insights will help to shape the company's marketing strategy. I conducted data analysis and made high-level recommendations for Bellabeat's marketing approach.\n","\n","# Ask Phase\n","### Business task\n","Analyze smart device usage data in order to gain insight into how consumers use non-Bellabeat smart devices.\n","\n","# Prepare Phase \n","* The data set was provided by Möbius \n","* License: CC0: Public Domain \n","* Source: https://zenodo.org/record/53894#.X9oeh3Uzaao\n","* Privacy: These datasets were generated by respondents to a distributed survey via Amazon Mechanical Turk between 03.12.2016-05.12.2016. Thirty eligible Fitbit users consented to the submission of personal tracker data, including minute-level output for physical activity, heart rate, and sleep monitoring.\n","### Data Credibility Check Using ROCCC Method\n","* Reliability This Kaggle data set has information from the personal fitness trackers of 30 eligible Fitbit users. The sample size is too small to be representative of the whole population, so there is a chance of bias.\n","   \n","* Originality:  The datasets come from the public domain and were not made by Amazon Mechanical Turk, which is the service provider. So, the datasets have low originality.\n","\n","* Comprehensive: The datasets are  missing information on age, gender, device type used on the tracking etc. hence, these datasets are not comprehensive.\n","\n","* Current:  These datasets were made six years ago, data may not be relevant.\n","\n","* Cited These datasets are thought to be crowdsourced data made by people who answered a distributed survey on Amazon Mechanical Turk. Because of this, the data source is thought to be properly cited."]},{"cell_type":"markdown","id":"75d7915d","metadata":{"_cell_guid":"89fff991-0e11-4d02-a067-6bf3ddfa9896","_uuid":"7d30d442-d60a-4162-9b41-aa980ac82677","papermill":{"duration":0.011174,"end_time":"2022-10-21T19:32:32.325404","exception":false,"start_time":"2022-10-21T19:32:32.31423","status":"completed"},"tags":[]},"source":["# Process Phase\n","\"R\" was used for data cleaning, transformation, analysis and visualization \n","### Load Packages"]},{"cell_type":"code","execution_count":2,"id":"ab13bc36","metadata":{"_cell_guid":"55a9e291-efde-4d89-9e5c-87bf545914eb","_uuid":"748eefe7-07c8-4301-8b43-8378ca862ba4","collapsed":false,"execution":{"iopub.execute_input":"2022-10-21T19:32:32.392132Z","iopub.status.busy":"2022-10-21T19:32:32.349929Z","iopub.status.idle":"2022-10-21T19:32:32.91866Z","shell.execute_reply":"2022-10-21T19:32:32.916822Z"},"jupyter":{"outputs_hidden":false},"papermill":{"duration":0.584553,"end_time":"2022-10-21T19:32:32.92136","exception":false,"start_time":"2022-10-21T19:32:32.336807","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_typ