10-21T19:32:38.166492","status":"completed"},"tags":[]},"source":["The plot above is showing positive correlation up to 1000 sedentary minutes. After 1000 sedentary minutes the relation is inverse."]},{"cell_type":"markdown","id":"f803794e","metadata":{"_cell_guid":"7f418843-f9e6-475e-838e-561739a87521","_uuid":"f19b96a5-7281-41dc-b3cf-679bb119134d","papermill":{"duration":0.015604,"end_time":"2022-10-21T19:32:38.213311","exception":false,"start_time":"2022-10-21T19:32:38.197707","status":"completed"},"tags":[]},"source":["# Act Phase\n","In light of the ROCCC's conclusion that the data quality is subpar, further validation is required.\n","\n","### Recommendations\n","* We discovered that the majority of people use the application to measure their steps and calories expended; fewer people use it to track their sleep, and very few use it to track their weight records. As a result, I recommend that the application prioritise step, calorie, and sleep tracking.\n","\n","* The association between steps taken and calories burned is positive, as is the correlation between very active minutes and calories burned. As a result, this could be an excellent marketing plan.\n","\n","* Sleep and calorie expenditure have a direct relationship. This can demonstrate to customers the advantages of tracking sleep in accomplishing weight loss goals.\n","\n","* The majority of fitness tracker users (62.5%) are overweight. there is a potential to persuade people to become healthy.\n","\n","* The Bellabeat marketing team can inspire customers by teaching and arming them with knowledge about fitness advantages, suggesting various sorts of activities, calorie intake, and burn rate information on the Bellabeat app."]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":10.531218,"end_